// Contact.jsx
import React from 'react';
import '../css/contact.css';

function Contact() {
  const contacts = [
    {
      label: 'Email',
      value: 'likhithsrinivas9@gmail.com',
      link: 'mailto:likhithsrinivas9@gmail.com',
    },
    {
      label: 'Phone',
      value: '+1 (934) 263-2462',
      link: 'tel:+19342632462',
    },
    {
      label: 'LinkedIn',
      value: 'srinivas-likhith',
      link: 'https://www.linkedin.com/in/srinivas-likhith/',
    },
    {
      label: 'GitHub',
      value: 'srinivaslikhith',
      link: 'https://github.com/srinivaslikhith',
    },
    {
      label: 'Instagram',
      value: '@yourhandle',
      link: 'https://instagram.com/YOUR_INSTAGRAM',
    },
  ];

  return (
    <section id="contact">
      <div className="contact-container">
        <h2 className="section-title">{'<Contact />'}</h2>

        <div className="contact-grid">
          {contacts.map((item, index) => (
            <a
              key={index}
              href={item.link}
              target="_blank"
              rel="noopener noreferrer"
              className="contact-card"
            >
              <span className="contact-label">{item.label}</span>
              <span className="contact-value">{item.value}</span>
            </a>
          ))}
        </div>
      </div>
    </section>
  );
}

export default Contact;
